//npm i bootstrap
//npm i react-router-dom --save

import React from 'react'
import HomeCards from './componentes/HomeCards'
import './App.css'
import {BrowserRouter as Router, Route, Switch} from "react-router-dom"
function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/home" component={HomeCards}/>
      </Switch>
    </Router>

  )
}

export default App
